const Detail = ({ id, nombre, imagen, types, vida, ataque, defensa, velocidad, altura, peso }) => {


    return (
        <div >

            <h2>detalle del pokemon</h2>
            <p>nombre: {nombre}</p>
            < img  src={imagen} alt="" />
            <p>vida: {vida}</p>
            <p>ataque: {ataquveloaltura}</p>
            <p>defensa: {defensa}</p>
            <p>velocidad: {velocidad}</p>
            <p>altura: {altura}</p>
            <p>peso: {peso}</p>
            <p>types: {types}</p>

        </div>
    )
}

export default Detail;
